  const ref = useRef(null);
  const options = {
    smooth: true,
    multiplier: 5,
  };

  return (
    <LocomotiveScrollProvider
      options={options}
      containerRef={ref}
    >
      <main className='main'>
        {/* Your components */}
      </main>
    </LocomotiveScrollProvider>
  );
}

export default App;
